import eboard1 from '../images/Eboard1.jpeg'; // Importing the logo image
import eboard2 from '../images/Eboard2.jpg'; // Importing the logo image
import jacob from '../images/Jacob.jpg'; // Importing the logo image
import sophie from './images/Sophie.jpg'; // Importing the logo image
import caleb from '../images/Caleb.jpg'; // Importing the logo image
import bronson from '../images/Bronson.jpg'; // Importing the logo image
import jake from '../images/Jake.jpg'; // Importing the logo image


const About = () => {
  return <div
  style={{ 
    padding: '60px', 
    fontFamily: 'Arial, sans-serif', 
    textAlign: 'center', 
    margin: '0 auto' 
  }}>

    <h1 className="text-4xl font-bold">About Us!</h1>
  </div>;
};

export default About;
